import React, { useEffect, useState } from 'react';
import { fetchDataFromBackend } from '../utils/api';
import PerformanceChart from './PerformanceChart';
import PerformanceSummary from './PerformanceSummary';

function MonthlyPerformance() {
  const [monthlyData, setMonthlyData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const data = await fetchDataFromBackend('/performance/monthly');
      setMonthlyData(data);
    };

    fetchData();
  }, []);

  return (
    <div className="monthly-performance">
      <h2>Monthly Performance</h2>
      <PerformanceChart data={monthlyData} />
      <PerformanceSummary data={monthlyData} />
    </div>
  );
}

export default MonthlyPerformance;
